import React from "react";
import "./Home.css";
import Navbar from "../components/Navbar";
import { useFirebaseApp, useUser } from "reactfire";

export default function Home() {
  const firebase = useFirebaseApp();
  const user = useUser();
  var x = "some string";
  alert(x.charAt(0));

  return (
    <div>
      <Navbar />
      <h1>{user.email}</h1>
    </div>
  );
}
